import React, { Component } from 'react';
import './SearchPage.css';
import Unsplash from 'react-unsplash-wrapper';
import Unsplash1 from 'react-unsplash-wrapper';
import {withProvider} from '../GlobalProvider.js';
import Test from './Test.js';


const Avatar = () => {
    <Unsplash width="64" height="64" keywords={this.props.searchword} />
}


class SearchOptions extends Component {
    render() { 
        return ( 
            <div class="container">

                <div class="d-flex justify-content-center">

                    <div style={{position: 'relative', width: 500, height: 400, margin: 'auto'}}>
                       {this.Avatar}
                    </div>
                        <span class="border border-light"></span>
                    <div style={{position: 'relative', width: 500, height: 400, margin: 'auto'}}>
                        <Unsplash1 keywords={this.props.searchword} expand />
                    </div>
                        <span class="border border-light"></span>
                    <div style={{position: 'relative', width: 500, height: 400, margin: 'auto'}}>
                        <Unsplash keywords={this.props.searchword} expand />
                    </div>
                </div>
            </div>
        );
    }
}

export default withProvider(SearchOptions);
